import React from 'react';
const Main = () => {
  const firstName = `Steven`;
  const lastName = `Yoh`
  return (
    <div className="main-home">
      <p>{firstName}</p>
      <p>{lastName}</p>
      <svg width="5000" height="3000" viewBox="0 0 5000 2000" fill="none" xmlns="http://www.w3.org/2000/svg">
    <g id="backdrop">
    <path id="backdrop-solid" d="M5000 1058H0V2000H5000V1058Z" fill="#6C63FF"/>
    </g>
    </svg>

    </div>
  )
}

export default Main;
